column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Anvendelse: nmcli device set { ARGUMENTER | help }

ARGUMENTER := ENHED { EGENSKAB [ EGENSKAB … ] }
ENHED      := [ifname] <gfnavn> 
EGENSKAB   := { autoconnect { yes | no } |
              { managed { yes | no }

Rediger enhedsegenskaber.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Anvendelse: nmcli general { KOMMANDO | help }

KOMMANDO := { status | hostname | permissions | logging }

  status

  hostname [<værtsnavn>]

  permissions

  logging [level <logniveau>] [domains <logdomæner>]

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Anvendelse: nmcli networking { KOMMANDO | help }

KOMMANDO := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Anvendelse: nmcli radio { KOMMANDO | help }

KOMMANDO := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Anvendelse: nmcli radio all { ARGUMENTER | help }

ARGUMENTER := [on | off]

Hent status på alle radiokontakter eller slå dem til/fra.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Anvendelse: nmcli radio wifi { ARGUMENTER | help }

ARGUMENTER := [on | off]

Hent status på wi-fi-radiokontakt eller slå den til/fra.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Anvendelse: nmcli radio wwan { ARGUMENTER | help }

ARGUMENTER := [on | off]

Hent status på bredbånd-radiokontakt eller slå den til/fra.
